import React from 'react';
import TextField from '@mui/material/TextField';

export const SleepingHours = ({ sleepingHours, handleChange }) => {

  return (
    <TextField
      fullWidth
      label="睡眠時間（例：7.5)"
      margin="dense"
      onChange={handleChange}
      required
      type="number"
      step="0.01"
      value={sleepingHours}
      variant="standard"
    />
  )
}
